node.text:
Happy anniversary Cercle Records! 🎂

One year of existence and already 19 tracks on the label… 

We could only put 10 tracks in the carousel, but we couldn’t be more grateful for each track that came out on the label.

Thanks to all the artists, labels, places, to all the technical teams who trusted us on those crazy adventures. And again, thanks to you guys for your love and support, we couldn’t do anything without all of you! ❤️‍🔥

You might soon have a big suprise… but in the meantime, get them all on our Cercle Records playlist! (link in bio)

Let us know which one is your favorite!

